import React from "react";
import { useParams } from "react-router-dom";
import MenuTabs from "./Menutabs";

export default function ViewEmployee() {
  const { empid, ename, designation, jdate, status } = useParams();

  return (
    <div>
      <MenuTabs />
      <div className="bg-white rounded-md p-4 flex flex-col gap-4">
        <div className="">
          <h1 className="font-bold">Personal Information</h1>
        </div>
        <div className="">
          <h1 className="font-bold">Employement Information</h1>
          <label>Employee ID: {empid}</label>
          <label>Name: {decodeURIComponent(ename)}</label>
          <label>Designation: {decodeURIComponent(designation)}</label>
          <label>Joining Date: {decodeURIComponent(jdate)}</label>
          <label>Status: {decodeURIComponent(status)}</label>
        </div>
      </div>
    </div>
  );
}
